INSERT INTO `wp_ak_storage` (`tag`, `lastupdate`, `data`) VALUES
('liveupdate_lastcheck', '2016-02-23 23:55:14', '1456271714'),
('liveupdate', '2016-02-23 23:55:15', '{"stuck":0,"software":"Akeeba Backup for WordPress","version":"1.6.4","link":"http:\\/\\/cdn.akeebabackup.com\\/downloads\\/backupwp\\/1.6.4\\/akeebabackupwp-core.zip","date":"2016-02-09","releasenotes":"<h3>Release highlights<\\/h3><p>    <strong>IMPORTANT! Behaviour change.<\\/strong> The enryption of JPS archives was improved. As a result you need to    use Kickstart 4.1.3 or later and UNiTE 2.0.2 or later to extract JPS archives taken with Akeeba Backup 4.5.2 and    later. At this point Akeeba eXtract Wizard DOES NOT support the new improved JPS archive format. No further updates    to eXtract Wizard are planned.<\\/p><p>    <strong>IMPORTANT! Behaviour change.<\\/strong> All remote backup features (front-end URL, JSON API) will be    automatically <em>disabled<\\/em> if you are using a Secret Word that''s not strong enough. This is done to protect    your against brute forcing of the Secret Word which could allow attackers to take and download backups of your    sites. Please read our release announcement for more information.<\\/p><p>\\tFurthermore we updated the copy of PHPmailer shipped with our software. Please note that Akeeba Solo and Akeeba\\tBackup were <strong>NOT<\\/strong> affected by the security issues discovered in old versions of PHPmailer.<\\/p><h3>Core and Professional versions<\\/h3><p>    Now all of our backup software (Akeeba Backup for Joomla! and    WordPress, as well as Akeeba Solo) come in two editions: Core and Professional. The Core version is provided free    of charge to everybody <em>WITHOUT having to subscribe, register or login<\\/em> and contains roughly 80% of the    features. The Professional version is only available to paid subscribers \\u2013depending on their subscription level\\u2013    and contains all the features. Support is only provided for the Professional version to eligible subscribers.<\\/p><p>    We strongly recommend installing and using the Core version before purchasing the Professional version. There are    no refunds given on grounds of server compatibility, usability or software capabilities since these can be easily    determined by installing the Core version on your server and\\/or reading our documentation, both available free of    charge to everybody. If you have a question regarding our software please use the Contact Us link to submit a    pre-sales request. Our staff will be most happy to respond to your requests!<\\/p><h3>PHP 5.3.3 or later or PHP 7 is required<\\/h3><p>    Good news, folks! We listened to your feedback and restored compatibility with all versions of    PHP from 5.3.04 onwards, including 5.4, 5.5, 5.6 and the just-released 7.0.    We''d like to remind you that most third party software which can be    backed up by our software do not necessarily support PHP 7. As a result we can''t guarantee the trouble-free    operation of the restoration procedure or the restored site if you are using PHP 7.<\\/p><p>    <small>Note: there is no such thing as PHP 6. PHP versions jumped from 5.6 to 7.0. Why? Well,        <a href=\\"https:\\/\\/philsturgeon.uk\\/php\\/2014\\/07\\/23\\/neverending-muppet-debate-of-php-6-v-php-7\\/\\" rel=\\"nofollow\\">it''s a long story<\\/a>. TL;DR: It doesn''t have to make sense, just accept it.    <\\/small><\\/p><h3>Changelog<\\/h3><h4>Bug fixes<\\/h4><ul>\\t<li>[HIGH] Language files processed by Transifex caused the language parser to throw errors<\\/li><\\/ul>","infourl":"https:\\/\\/www.akeebabackup.com\\/download\\/backupwp\\/1-6-4.html","md5":"d995f1451cc096bce30a4bd2769964c0","sha1":"8c0382b191d807481eb68166ec3a0d4bbbaeb075","platforms":"wordpress\\/3.8+,php\\/5.3,php\\/5.4,php\\/5.5,php\\/5.6,php\\/7.0"}');
