(2900, 'wonderplugin_slider_information', 's:3615:"O:8:"stdClass":15:{s:6:"author";s:19:"Magic Hills Pty Ltd";s:8:"homepage";s:46:"https://www.wonderplugin.com/wordpress-slider/";s:4:"name";s:19:"WonderPlugin Slider";s:8:"requires";s:3:"3.6";s:6:"tested";s:5:"4.3.1";s:7:"version";s:3:"5.8";s:11:"new_version";s:3:"5.8";s:12:"last_updated";s:10:"2015-11-23";s:8:"sections";a:1:{s:10:"change log";s:3055:"<h4>Version 5.8</h4>\n<ul>\n<li>Support trash in slider management. The deleted slider will be moved to the trash in which you can restore or permanently delete it.</li>\n</ul>\n<h4>Version 5.7</h4>\n<ul>\n<li>Support lightbox auto slideshow</li>\n<li>Add an option to always show the previous and next navigation arrows on lightbox</li>\n<li>Display error notice on the WordPress Updates page if the free upgrade period is expired.</li>\n</ul>\n<h4>Version 5.6</h4>\n<ul>\n<li>Add an option to support adding the new item to the beginning of the list\n</li>\n<li>Add a function to reverse the media list</li>\n</ul>\n<h4>Version 5.5</h4>\n<ul>\n<li>Fix the bug of resuming slideshow autoplay when lightbox is closed</li>\n<li>Add an option to hide MP4/WebM video play control bar on lightbox</li>\n<li>Add an option to display text on bottom, inside, left or right of the lightbox</li>\n<li>Add an option to display lightbox in fullscreen mode. In fullscreen mode, the close button will be displayed on the top right corner of the web browser</li>\n<li>Add an option to add prefix to title when the lightbox is displayed in gallery mode</li>\n<li>Add an option to enable or disable closing lightbox when clicking on the overlay background</li>\n<li>Move the left and right navigation arrows to the side of lightbox on touch screen. This will fix the issue of double clicking when playing video on iPhone, iPad and Android.</li>\n</ul>\n<h4>Version 5.4</h4>\n<ul>\n<li>Fix the bug of playing MP4 video on iPad iOS 9.1\n</li>\n</ul>\n<h4>Version 5.3</h4>\n<ul>\n<li>Fix the bug of video lightbox in iPad 2\n</li>\n</ul>\n<h4>Version 5.2</h4>\n<ul>\n<li>Support WordPress posts slider: create slider from recent posts or posts in specified categories\n</li>\n</ul>\n<h4>Version 5.1</h4>\n<ul>\n<li>Fix a minor bug of version 5.0\n</li>\n</ul>\n<h4>Version 5.0</h4>\n<ul>\n<li>Fix a bug of playing mp4 video in the lightbox popup under Firefox\n</li>\n</ul>\n<h4>Version 4.9</h4>\n<ul>\n<li>Fix bugs\n</li>\n</ul>\n<h4>Version 4.7</h4>\n<ul>\n<li>Fix a bug in responsive design\n</li>\n</ul>\n<h4>Version 4.6</h4>\n<ul>\n<li>Support adding alt text for slider images\n</li>\n</ul>\n<h4>Version 4.5</h4>\n<ul>\n<li>Fix bugs\n</li>\n</ul>\n<h4>Version 4.4</h4>\n<ul>\n<li>Add options to change the aspect ratio of sliders on small screen devices\n</li>\n</ul>\n<h4>Version 4.3</h4>\n<ul>\n<li>Add effects Tiles, Ken Burns, Flip, Flip with zoom\n</li>\n<li>Create <a href="/wordpress-slider/examples/wordpress-ken-burns-slider-id43/" target="_blank">WordPress Ken Burns Slider</a>\n</li>\n<li>Add 3D effects 3D with zoom, 3D horizontal with zoom, 3D flip, 3D flip with zoom, 3D tiles\n</li>\n<li>Create <a href="/wordpress-slider/examples/wordpress-3d-slider-id44/" target="_blank">WordPress 3D Slider</a>\n</li>\n<li>Add options to define thumbnail width and height\n</li>\n<li>Add an option to add slider js files to the footer\n</li>\n<li>Add an option to display sliders in text widgets\n</li>\n<li>Add options to define responsive CSS for texts on small screens\n</li>\n</ul>\n<h4>Version 4.2</h4>\n<ul>\n<li>Support version check and update\n</li>\n</ul>";}s:3:"key";s:0:"";s:10:"key_status";s:5:"empty";s:10:"key_expire";i:0;s:4:"slug";s:19:"wonderplugin-slider";s:6:"plugin";s:42:"wonderplugin-slider/wonderpluginslider.php";s:12:"last_checked";i:1449111959;}";', 'yes'),
