(10597, 1063, 'extra_content', 'The Dreamseeker Byron DLX Semi off-road caravan comes with a tough suspension and protection so that you can handle a dirt road track. The Byron DLX Semi off-road come in three amazing layouts!'),
(10598, 1063, '_extra_content', 'field_5624bb3ca3a02'),
