(10602, 1063, '_image_text_panel_0_feature_heading', 'field_55de8577aa0a4'),
(10603, 1063, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Byron DLX has to offer. The model has a number of premium features which are included standard.'),
