(10613, 1063, 'image_text_panel_1_feature_heading', 'CREATURE COMFORTS'),
(10614, 1063, '_image_text_panel_1_feature_heading', 'field_55de8577aa0a4'),
(10615, 1063, 'image_text_panel_1_feature_text', 'The Byron DLX Semi off-road is packed with premium features such as a spacious l-shaped lounge that drops down to a bed, a tri-fold bed above lounge, queen island bed with inner spring mattress, separate shower and toilet, full oven, 184Ltr 3-way fridge/freezer, Ibis reverse-cycle air conditioner and much more.\r\n\r\n\r\n5 STAR LIVING QUARTERS\r\nYou will feel right at home with the Byrons smart and luxurious interior. The vans living quarters are modern, fresh and have been designed to maximise space and comfort.'),
