(11590, 1160, '_extra_title', 'field_5624bb2ba3a01'),
(11591, 1160, 'extra_content', 'The Dreamseeker Byron DLX caravan comes with luxury features which will maximise your travel experience. The Byron DLX come in three amazing layouts!'),
(11592, 1160, '_extra_content', 'field_5624bb3ca3a02'),
(11593, 1160, 'text_color', '#cecece'),
