(11595, 1160, 'image_text_panel_0_feature_heading', 'FUNCTIONAL ELEGANCE'),
(11596, 1160, '_image_text_panel_0_feature_heading', 'field_55de8577aa0a4'),
(11597, 1160, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Byron DLX has to offer. The model has a number of premium features which are included standard.'),
(11598, 1160, '_image_text_panel_0_feature_text', 'field_55de858aaa0a5'),
