(11609, 1160, 'image_text_panel_1_feature_text', 'The Byron DLX is packed with premium features such as a spacious l-shaped lounge that drops down to a bed, a tri-fold bed above lounge, queen island bed with inner spring mattress, separate shower and toilet, full oven, 184Ltr 3-way fridge/freezer, Ibis reverse-cycle air conditioner and much more.\r\n\r\n\r\n5 STAR LIVING QUARTERS\r\nYou will feel right at home with the Byrons smart and luxurious interior. The vans living quarters are modern, fresh and have been designed to maximise space and comfort.'),
