(15362, 1507, 'image_text_panel_0_feature_heading', 'AFFORDABLE LUXURY'),
(15363, 1507, '_image_text_panel_0_feature_heading', 'field_55de8577aa0a4'),
(15364, 1507, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Irwin has to offer. The model has exceptional aesthetic qualities that are functional, making the Irwin the ultimate van for you journey.'),
