(15374, 1507, 'image_text_panel_1_feature_heading', 'FUNCTIONAL ELEGANCE'),
(15375, 1507, '_image_text_panel_1_feature_heading', 'field_55de8577aa0a4'),
(15376, 1507, 'image_text_panel_1_feature_text', 'The Irwin captures the gaze of all with its checker plate front,  sides and back, not to mention it''s gleaming silver ali-comp cladding.\r\n\r\nThe Irwin is equipped externally with a front tunnel boot, spare wheel mounted to the back, fold-out picnic table, gas bayonet, generator hatch, 150 watt solar panel and 2 x jerry can holders. \r\n\r\nBuilt to impress, the Irwin will surely gain attention whilst dynamically moving throughout the country.'),
