(16225, 1565, 'image_text_panel_0_feature_heading', 'AFFORDABLE LUXURY'),
(16226, 1565, '_image_text_panel_0_feature_heading', 'field_55de8577aa0a4'),
(16227, 1565, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Bradman has to offer. The model has exceptional aesthetic qualities that are functional, making the Bradman the ultimate van for you journey.'),
