(16238, 1565, '_image_text_panel_1_feature_heading', 'field_55de8577aa0a4'),
(16239, 1565, 'image_text_panel_1_feature_text', '<p>The Bradman captures the gaze of all with its padded front, checker plate sides, not to mention it''s gleaming silver aluminium cladding.</p>\r\n\r\n<p>The Bradman  is equipped externally with a front boot, spare wheel mounted to the back, fold-out picnic table, gas bayonet, generator hatch, 120 watt solar panel and external speakers. </p>\r\n\r\n<p>Built to impress, the Bradman will surely gain attention whilst dynamically moving throughout the country.</p>'),
