(19905, 1895, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Oodnadatta Ultimate has to offer. The model has exceptional aesthetic qualities that are functional, making the Oodnadatta the ultimate van for you journey.'),
