(19917, 1895, 'image_text_panel_1_feature_text', 'The Oodnadatta captures the gaze of all with its front mesh stone shield front, tool box, checker plate front & sides, not to mention it''s gleaming silver aluminium cladding.\r\n\r\nThe Oodnadatta is equipped externally with a front boot, 2 x spare wheels mounted to the back, fold-out picnic table, gas bayonet, 2 x 150 watt solar panels and DO35 hitch\r\n\r\nBuilt to impress, the Oodnadatta will surely gain attention whilst dynamically moving throughout the country.'),
