(20624, 1948, 'extra_content', 'The Dreamseeker Dundee Ultimate is a tough off-road caravan \r\nwith all the features you need to get you through the roughest terrain. \r\n'),
(20625, 1948, '_extra_content', 'field_5624bb3ca3a02'),
(20626, 1948, 'text_color', '#cecece'),
