(20628, 1948, 'image_text_panel_0_feature_heading', 'AFFORDABLE LUXURY'),
(20629, 1948, '_image_text_panel_0_feature_heading', 'field_55de8577aa0a4'),
(20630, 1948, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Dundee Ultimate has to offer. The model has exceptional aesthetic qualities that are functional, making the Dundeee the ultimate van for you journey.'),
