(21448, 2029, 'extra_content', 'The Dreamseeker Kelly is a sleek modern van \r\nthat comes with luxury features at an affordable price.'),
(21449, 2029, '_extra_content', 'field_5624bb3ca3a02'),
(21450, 2029, 'text_color', '#cecece'),
