(21452, 2029, 'image_text_panel_0_feature_heading', 'AFFORDABLE LUXURY'),
(21453, 2029, '_image_text_panel_0_feature_heading', 'field_55de8577aa0a4'),
(21454, 2029, 'image_text_panel_0_feature_text', 'Discover the high-quality craftsmanship that the Kelly has to offer. The model has exceptional aesthetic qualities that are functional, making the Kelly the ultimate van for you journey.'),
(21455, 2029, '_image_text_panel_0_feature_text', 'field_55de858aaa0a5'),
