(21465, 2029, '_image_text_panel_1_feature_heading', 'field_55de8577aa0a4'),
(21466, 2029, 'image_text_panel_1_feature_text', 'The Kelly captures the gaze of all with its checker plate front,  sides and back, not to mention it''s gleaming silver ali-comp cladding.\r\n\r\nThe Kelly is equipped externally with a front tunnel boot, spare wheel mounted to the back, fold-out picnic table, gas bayonet, generator hatch, 150 watt solar panel and \r\n2 x jerry can holders. \r\n\r\nBuilt to impress, the Kelly will surely gain attention whilst dynamically moving throughout the country.'),
