(122, 1, '2015-08-07 10:39:23', '2015-08-07 10:39:23', 'DreamseekerÂ provides the original purchaser of every DreamseekerÂ a 12 month warranty that the productâs workmanship and materials will be free from defects.\r\n\r\nThe warranty period commences on the date of purchase.\r\n\r\nWarranty repairs and replacements will be undertaken by Dreamseeker or an authorised repairer. Warranty repairs and replacements will be free of charge unless an on-site repair is requested in which case a service call fee will apply.\r\n\r\nUnless the owner has prior written consent from Dreamseeker, under the Warranty Dreamseeker will not reimburse the owner under the Warranty for repairs undertaken by an unauthorised repairer.\r\n\r\nThe Warranty will not apply in certain circumstances, including where the CaravanÂ has been:\r\n<ul>\r\n	<li>Used for a purpose other than which it was designed;</li>\r\n	<li>Used for commercial purposes;</li>\r\n	<li>In an accident; or</li>\r\n	<li>Towed by a vehicle other than a standard passenger vehicle.</li>\r\n</ul>\r\nThe Warranty will also not extend to specific types of damage including:\r\n<ul>\r\n	<li>Wear and tear when the caravan has been used for permanent living purposes;</li>\r\n	<li>Tears, punctures, and fading to fabric items; or</li>\r\n	<li>Damage caused by alterations or repairs being undertaken by an unauthorised repairer.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<strong>OFF-ROAD POLICY</strong>\r\n\r\nDreamseekerÂ off-road range of caravans have been designed and constructed to give added strength and ground clearance, for limited unsealed road usage. Gas venting regulations and other construction restraints limit the effectiveness of these caravans against dust and water penetration. Under no circumstances should these caravans be exposed to water crossings at, or above, body floor level.\r\n\r\nWe strongly recommend towing at safe speed according to travel conditions with extra care and attention required on uneven surfaces. Our off-road caravans are not designed for hard impact or heavy landings or severely rutted roads or tracks.\r\n\r\nDreamseeker off-road are not designed for use on four wheel drive only tracks.\r\n\r\nThe following items for off-road caravans are not covered under Dreamseeker warranty:\r\n<ul>\r\n	<li>Impact or stone damage to body, chassis or running gear.</li>\r\n	<li>Soiling of fabrics and internal fitments from dust and other airborne substances.</li>\r\n	<li>Water damage due to water crossings.</li>\r\n	<li>Movement or damage caused by dislodgment of appliances and fittings resulting from hard impact or heavy landings or severely rutted roads or tracks.</li>\r\n	<li>General damage arising from misuse.</li>\r\n	<li>The Warranty does not extend to maintenance items which are theÂ Â  responsibility of the purchaser.</li>\r\n</ul>\r\nDreamseekerÂ Caravans include equipment and fittings, such as cooking appliances, tyres and toilets, which are separately warranted by their manufacturer and not covered by Dreamseekerâs Warranty. If necessary, DreamseekerÂ will help an owner make a warranty claim to these individual component manufacturers.\r\n\r\nThe purchaser of a Dreamseeker Caravans will be provided with a Customer Care Card. You are required to present this card when making a warranty claim.\r\n\r\nFor full terms and conditions of Dreamseekerâs warranty program, please refer to your ownerâs handbook provided with your caravan. The ownerâs handbook sets out further information on what you must do should a warranty fault occur, and what will and will not be covered.', 'Terms and Conditions', '', 'publish', 'open', 'open', '', 'terms-and-conditions', '', '', '2016-02-23 23:18:28', '2016-02-23 23:18:28', '', 0, 'http://192.168.1.20/dreamseeker_wp/?page_id=122', 0, 'page', '', 0),
